script: |
  super -f text -I q12804.spq | sort > q12804.out

inputs:
  - name: q12804.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE NOT - col0 BETWEEN - col1 AND ( + - 11 ) * + 49 * - 23 + - - ( - col2 ) * + col2 + 52 - + ( col1 ) * + col1;
  - name: tab0

outputs:
  - name: q12804.out
    data: |
      87	21	10
      97	1	99
